import styled from 'styled-components';
import music from '../assets/audio/u-said-it-v13-1167.mp3';

const Box = styled.div`
  display: flex;
  cursor: pointer;
  position: fixed;
  left: 8rem;
  top: 3rem;
  z-index: 10;
`

const SoundBar = () => {
    return (
        <Box>
            Sound

            <audio src={music} />
        </Box>
    )
}

export default SoundBar;
